import '../CSSContents/Shop.css'

function Shop() {

    const items = [
        { id: 1, name: 'T-shirt', price: 10, image: '' },
        { id: 2, name: 'Custom T-shirt', price: 20, Image: '' },
        { id: 3, name: 'patch', price: 30, image: 'images/shop/patch.png' },
        { id: 4, name: 'cap', price: 40, image: '' },
        { id: 5, name: 'bandana', price: 50, image: '' },
        { id: 6, name: 'bag', price: 70, image: '' },
    ];



    return (
        <div className="Shop">

            <h1>Shopping Page</h1>
            <div className="item-list">
                {items.map((item) => (
                    <div key={item.id} className="item">
                        <img src={item.image} alt={item.name} />
                        <h3>{item.name}</h3>
                        <p>${item.price}</p>
                    </div>
                ))}
            </div>
        </div>




    )
}

export default Shop;
